class Encaptcha {
	constructor(raw){
		this.container = raw.config.container;
		this.lap = parseInt(raw.config.reload_interval) || 30;
		this.reload_btn_text = raw.config.reloadBtn_text || 'Reload';
		
		this.final 		= null;
		this.timestamp 	= null;
		this.reload_btn = null;
		this.canvas		= null;
		this.ctx 		= null;
		this.input 		= null;
		this.sprite		= null;

		this.char_count	= null;
		this.timerHandler = null;
		this.char_diam  = null;
		this.canvas_diam= null;
		this.atlas		= [{"name":"F","x":75,"y":0,"width":74,"height":97},{"name":"G","x":375,"y":0,"width":74,"height":97},{"name":"H","x":0,"y":98,"width":74,"height":97},{"name":"I","x":75,"y":98,"width":74,"height":97},{"name":"J","x":150,"y":0,"width":74,"height":97},{"name":"K","x":150,"y":98,"width":74,"height":97},{"name":"L","x":0,"y":196,"width":74,"height":97},{"name":"M","x":75,"y":196,"width":74,"height":97},{"name":"N","x":150,"y":196,"width":74,"height":97},{"name":"O","x":225,"y":0,"width":74,"height":97},{"name":"P","x":225,"y":98,"width":74,"height":97},{"name":"Q","x":225,"y":196,"width":74,"height":97},{"name":"R","x":300,"y":0,"width":74,"height":97},{"name":"S","x":300,"y":98,"width":74,"height":97},{"name":"T","x":300,"y":196,"width":74,"height":97},{"name":"U","x":0,"y":294,"width":74,"height":97},{"name":"v","x":75,"y":294,"width":74,"height":97},{"name":"W","x":150,"y":294,"width":74,"height":97},{"name":"X","x":225,"y":294,"width":74,"height":97},{"name":"Y","x":300,"y":294,"width":74,"height":97},{"name":"Z","x":0,"y":0,"width":74,"height":97},{"name":"#","x":365,"y":490,"width":69,"height":87},{"name":"$","x":295,"y":490,"width":69,"height":87},{"name":"%","x":225,"y":490,"width":69,"height":87},{"name":"&","x":0,"y":392,"width":74,"height":97},{"name":"@","x":75,"y":392,"width":74,"height":97},{"name":"0","x":150,"y":392,"width":74,"height":97},{"name":"1","x":225,"y":392,"width":74,"height":97},{"name":"2","x":300,"y":392,"width":74,"height":97},{"name":"3","x":375,"y":392,"width":74,"height":97},{"name":"4","x":450,"y":0,"width":74,"height":97},{"name":"5","x":450,"y":98,"width":74,"height":97},{"name":"6","x":450,"y":196,"width":74,"height":97},{"name":"7","x":450,"y":294,"width":74,"height":97},{"name":"8","x":450,"y":392,"width":74,"height":97},{"name":"9","x":0,"y":490,"width":74,"height":97},{"name":"A","x":75,"y":490,"width":74,"height":97},{"name":"B","x":375,"y":294,"width":74,"height":97},{"name":"C","x":375,"y":196,"width":74,"height":97},{"name":"D","x":375,"y":98,"width":74,"height":97},{"name":"E","x":150,"y":490,"width":74,"height":97}];
		this.subAtlas	= [];
	}

	cook_meta(){
		let min = 4;
		let max = 7;
		this.char_count = Math.floor(Math.random() * (max - min + 1)) + min;
		this.char_diam = {width: 40, height: 'auto'};
		this.canvas_diam = { width: (this.char_count * this.char_diam.width), height: 50 }
	}

	crerate_dom(){
		var self = this;
		let wrapr = document.createElement('div');
		wrapr.setAttribute('style', 'display: flex; flex-direction:column; background-color:#CCC; padding:3px 4px; width:'+((this.char_diam.width * 7) +14)+'px; margin:0px;');
		wrapr.setAttribute('class', 'enc-wrapper');
		wrapr.setAttribute('id', 'enc-wrapper_0'+document.querySelectorAll('.enc-wrapper').length);

			let top_n = document.createElement('div');
			top_n.setAttribute('style', 'width:100%;') ;
			top_n.setAttribute('class', 'enc-wrapper-topn');

				let timestamp = document.createElement('label');
				timestamp.innerHTML = 'Initializing...';
				timestamp.setAttribute('style', 'font-size: 0.8em; float: left;');
				timestamp.setAttribute('class', 'enc-wrapper-topn-timestamp');
				this.timestamp = timestamp;
			
				let reload_btn = document.createElement('a');
				reload_btn.setAttribute('style', 'text-decoration:none; float:right; font-size:0.8em; cursor:pointer;')
				reload_btn.innerHTML = this.reload_btn_text;
				
				reload_btn.addEventListener('click', function(e){
					// clearInterval(self.timerHandler);
					self.draw_canvas();
				})

				this.reload_btn = reload_btn;

			let cap_cont = document.createElement('div');
			cap_cont.setAttribute('style', 'text-align: center;')
				
				let canvas = document.createElement('canvas');
				canvas.width = this.canvas_diam.width;
				canvas.height = this.canvas_diam.height;
				this.canvas = canvas;
				this.ctx = canvas.getContext('2d');

			let input_cont = document.createElement('div');
				input_cont.setAttribute('style', 'text-align: center;')
				let ip = document.createElement('input');
				ip.setAttribute('type', 'text');
				ip.setAttribute('id', 'enc-ip_0'+document.querySelectorAll('.enc-wrapper').length)
				ip.setAttribute('style', 'width:80%; height:100%; text-align: center; font-size:25px;letter-spacing: 3px;');
				this.input = ip;

		top_n.appendChild(timestamp);
		top_n.appendChild(reload_btn);
		cap_cont.appendChild(canvas);
		input_cont.appendChild(ip)
		
		wrapr.appendChild(top_n);
		wrapr.appendChild(cap_cont);
		wrapr.appendChild(input_cont);

		this.final = wrapr;

		
	}

	load_spriteData(){
		this.sprite = new Image();
		this.sprite.onload = function(){
			// console.log('this.sprite loaded')
		}
		this.sprite.src = 'data:image/png;base64,'
	}

	draw_canvas(){
		var filled_width = 0;
		clearInterval(this.timerHandler);
		this.subAtlas.length = 0;
		this.ctx.clearRect(0,0,this.canvas_diam.width, this.canvas_diam.height);
		for(let i = 0; i < this.char_count; i++){
			let index = parseInt(Math.floor(Math.random() * this.atlas.length) + 0);
			this.subAtlas.push(this.atlas[index]);
			this.ctx.drawImage(this.sprite, this.subAtlas[i].x, this.subAtlas[i].y, this.subAtlas[i].width, this.subAtlas[i].height, filled_width, 0, this.char_diam.width, 50 );	
			filled_width += this.char_diam.width;			
		}
		this.start_timer();
	}

	start_timer(){
		
		var self = this;
		var lock = self.lap;

		self.timerHandler = setInterval(function(){
			lock --;
			if(lock == 0){
				self.draw_canvas();
			}
			self.timestamp.innerHTML = 'Valid for '+lock+' sec'; 
		}, 1000);

	}
}

Encaptcha.prototype.start = function(){
			
	if(window.jQuery){
		if(jQuery(this.container).length == 1){
			var self = this;
			this.cook_meta();
			this.crerate_dom();
			this.load_spriteData();
			this.draw_canvas();
			jQuery(this.container).append(this.final)
		}
		else
			console.log('Value of [container] passed in config is INVALID ( either not-UNIQUE or doesnt exist in the current page)')
	}
	else
		console.log('jQuery not loaded')
}